      title: "Hong Kongâ€ˆğŸ‡­ğŸ‡°",
      content:
        "There is a lot to gush about Hong Kong! So much charm and convenience packed into such a small area. It can best be described as unapologetically lived in, highly functional, ultra-convenient, and a pleasant mix of Asian and Western culture.\nSome examples:\n\tâ€¢ The escalators going into and out of the metro move faster than anywhere Iâ€™ve been.\n\tâ€¢ Doing line transfers in the metro is as simple as walking in a straight line on the same platform; from one track to the next.\n\tâ€¢ Convenience stores are plentiful to the point where you can sometimes see two or even three within the same line of sight. \n\tâ€¢ Food options are a great variety of Cantonese and every East + Southeast Asian country.\nOh! and as a nice little bonus, a lot of people speak English! \nI had a wonderful time exploring Hong Kong. It was my last stop in my ~5 month (breaks included) span across East + Southeast Asia and itâ€™s easy to say that it ended on a high note. I got to reunite with friends Iâ€™ve made over the past year in the place they call home while also meeting new ones. I got to experience a level 10 typhoon and get stuck in a country for the first time. On top of that, I got to do all the sightseeing I wanted and more because of my extra time here!\nMy only hope is that all the things I love about this city stay exactly the same for future visits. Something tells me that this sadly wonâ€™t be the case but only time will tell! Until then, I want to give a big BIG shoutout and say thank you again to my friends Edwin, Yvonne, Garth, and Long for showing me around and helping me grow my love for Hong Kong. Iâ€™ll forever cherish the time I had here thanks to you all.",
