      title: "Manila, Philippinesâ€ˆğŸ‡µğŸ‡­",
      content:
        "Finally in the Philippines! My entire stay here felt like a wonderful ending to my Southeast Asia trip. The biggest things that stood out to me in Manila were the food, Binondo, and the Jeepneys!\nIâ€™m a little ashamed to admit this butâ€¦before this, I had never had Filipino food (not even Jollibee). The first thing I did was go out with Patrick to try EVERYTHING! It was spectacular! Letâ€™s just say that Iâ€™m gonna be taking some notes from my S/Oâ€™s mom whenever I get the chance to be in the kitchen with her ğŸ¤¤\nManila also hosts the oldest Chinatown in the world in the form of Binondo. I felt super lucky to have both Patrick and Andrew show me around where they both essentially grew up. What they had taken as everyday familiarity, I saw as unique and interesting. Good eats, good vibes, and good memories! Thank you both for being awesome friends and awesome tour guides!\nAnd finally, what you see me hanging onto in one of the photos is quite possibly the most unique mode of transportation Iâ€™ve seen in all my traveling. The Jeepney! You wonâ€™t find them as an option on Google Maps, the routes are painted on the sides of the colorfully painted exterior and are only found in the Philippines. I learned about them from seeing Toro y Moiâ€™s extremely eye-catching cover of his latest album Mahal. I became fascinated by the aesthetics and history of them from the moment I saw it. It felt so cool just seeing them literallyâ€¦everywhere! Go out and see them while you can!\nSalamat Manila! Will be back to hopefully catch some waves next time ğŸ„â€â™‚ï¸",
