    caption: {
      title: "Rio de Janeiro | SÃ£o Paulo | Caraguatatuba, Brazilâ€ˆğŸ‡§ğŸ‡·",
      content:
        "I love Brazil, and Brazil loves me too! I've always wanted to visit Brazil but felt like I needed to get a little bit of traveling experience under my belt before taking the plunge. Having some friends from Brazil wouldâ€™ve made me feel a lot more comfortable as well, and thankfully while in Europe I found Pedro and Samanta.\nI met Pedro in a bar in Budapest while we were both traveling through Europe. We were both very similar. Both worked in tech, both doing our first serious traveling, both liked to party (in moderation) and more! At some point in the conversation, he said very genuinely that I should come to Rio de Janeiro for Carnival in February! All while telling me all about how much fun he, his friends, and the entire country have while celebrating the holiday! Without any hesitation, I agreed to go, and when I got back from Europe, it was the next trip I started planning!\nFast forward a few months, and there I was! In Brazil, at Pedroâ€™s, enjoying life like a Carioca. Looking back, I guess it was a little insane. Staying in the home of a friend that I had met ONCE across the world, in Rio of all places, just off of one single conversation. I honestly had very little doubt about the absurdity of it all, and thankfully the leap of faith paid off, and I had the time of my life! The first few days were chill and felt like a great vacation. Seeing the touristy sites of Rio, trying out all the delicious and unique Brazilian food, and learning how to manage getting around the city without running into issues. Then after a few days, the festivities began!\nAll of Pedroâ€™s lifelong friends (brothers in my eyes) came to Rio to stay with us and then the real fun began. All of us, going from bloco to bloco, day after day for 5 days days straight! Insane!! The closest way to describe it would be like if you went to a music festival, but the festival is scattered throughout a gigantic and beautiful city, and EVERYONE is huge HUGE fan of every artist on the lineup! Everyone is singing along! Everyone is dancing! Everyone is included! Everyone is having the best day of their life! I loved Carnival sooo so much and while a lot of that love comes from Carnival itself, I feel like a lot of that love was thanks to all the friends who made me feel so included and loved during the entirety of it.\nI couldnâ€™t party forever thoughâ€¦so after Rio I did a small trip to IguaÃ§u Falls to experience one of the natural wonders of Brazil (more on that later), then SÃ£o Paulo to experience a more metropolitan version of Brazil, and finally ending up in Caraguatatuba at Samantaâ€™s to experience the laid back beachy vibes of Brazil. Samanta and I met in our hostel in Rome, and by then I had already had my sights set on visiting Brazil. She was happy to host me once I told her about my travel plans, so we made it happen! Getting to experience the more relaxing, quiet, and more local vibe was exactly what I needed after the nearly nonstop action of Rio.\nI cannot wait to visit again! Brazil is a HUGE country, with the same square mileage as the continental US! Definitely wouldnâ€™t mind checking out more of the national parks, eating more Brazilian food, and of course spending time with my new friends. Maybe Iâ€™ll know a bit more Portuguese by then! Until then, valeu valeu obrigado!",
      publishDate: "March 21, 2023",
    },
